// src/data/hospitals.js
const hospitals = [
    {
      hospital_id: 1,
      name: 'Apollo Hospital',
      address: '123 Main Street, Delhi',
      about: 'Apollo Hospital is a leading healthcare provider offering comprehensive medical services.',
      contact: '+91-1234567890',
      added_date: '2023-01-01T10:00:00Z',
      image: '/assets/images/apollo.jpg',
    },
    {
      hospital_id: 2,
      name: 'Fortis Healthcare',
      address: '456 Elm Street, Mumbai',
      about: 'Fortis Healthcare specializes in advanced medical treatments and patient care.',
      contact: '+91-0987654321',
      added_date: '2023-02-15T12:30:00Z',
      image: '/assets/images/fortis.jpg',
    },
    // Add more hospitals as needed
  ];
  
  export default hospitals;
